// components/RecipeSummary.js
import React from 'react';

const RecipeSummary = ({ match, recipes }) => {
  const recipe = recipes[match.params.id].recipe;

  return (
    <div>
      <h2>Summary for {recipe.label}</h2>
      <p>{recipe.source}</p>
      <p>{recipe.url}</p>
      <p>{recipe.calories}</p>
      <p>{recipe.totalTime}</p>
    </div>
  );
};

export default RecipeSummary;
